import React from 'react';
import c from './NavBar.module.css';

function NavBar() {
    return (
        <nav className={c.nav}>
            <a href="#r" className={c.item}><img scr = 'https://cdn.discordapp.com/attachments/663414102202384410/723184764814884874/2.png'/></a>
            <div></div>
            <a href="#r" className={c.item}>Messages</a>
            <div></div>
            <a href="#r" className={c.item}>News</a>
            <div></div>
            <a href="#r" className={c.item}>Music</a>
            <div></div>
            <a href="#r" className={c.item}>Settings</a>
        </nav>
    )
}

export default NavBar;
